import React from 'react';

/**
 * AdminSettings will allow configuring store information, payment
 * gateways, shipping zones, taxes and user roles.  This placeholder
 * hints at future settings forms and toggles.
 */
function AdminSettings() {
  return (
    <div>
      <h1 className="text-2xl font-semibold mb-4">Настройки магазина</h1>
      <p className="text-gray-600">Эта страница предназначена для конфигурации общего оформления магазина, настройки способов оплаты, расчёта доставки и налогов, локали и управления ролями пользователей.</p>
    </div>
  );
}

export default AdminSettings;
